import React from "react";
import PageWrapper from "./componets/PageWrapper";
import { BrowserRouter as Router, Route } from "react-router-dom";

// Pages
import Home from "./componets/Pages/Home";
import About from "./componets/Pages/AboutUs";
import MainServices from "./componets/Pages/MainServices";
import Contact from './componets/Common/Contact'
import MainTeam from './componets/Pages/'

function App() {
  return (
    <Router>
      <PageWrapper>
        <Route exact={true} path="/" component={Home} />

        <Route path="/about" component={About} />

        <Route path="/services" component={MainServices} />

        <Route path="/contact" component={Contact} />

        <Route path="/team" component={MainTeam} />
      </PageWrapper>
    </Router>
  );
}

export default App;
